import React from "react";

const Home = () => {
    return (
        <div className="p-8 bg-gray-100 min-h-screen flex flex-col items-center justify-center">
            <h1 className="text-4xl font-bold text-blue-500 mb-4">Bienvenido a Nuestra Clínica</h1>
            <p className="text-lg text-gray-700 text-center">
                Ofrecemos los mejores servicios para tu salud y bienestar. ¡Conócenos!
            </p>
        </div>
    );
};

export default Home;
